[Form]
public class InventTransDetails extends FormRun
{
    boolean                             hasCachedDisplayMethods;

    InventTransReference                inventTransReference;

}

void doResearch()
{
    inventTransOrigin_DS.research();
}

void enableButtons()
{
    inventSettlementTree.enabled(inventTrans.isUpdatedFinancial());
    pdsBatchAttributes.enabled(inventDim.InventBatchId != '');
    ledgerTransVoucher_UnpostedInvoices.enabled(inventTrans.hasUnpostedInvoices() == HasUnpostedInvoices::Yes);
    InventReserve.enabled(InventTransOrigin.ReferenceCategory != InventTransType::WHSWork);
}

void init()
{
    super();

    if (RetailSMB::IsRetailSMBEnabled())
    {
        RetailSMB::SetVisible(element);
    }
}

void setInventTransReference(InventTrans _inventTrans)
{
    if (!inventTransReference)
    {
        inventTransReference = InventTransReference::newFromInventTrans(_inventTrans);
    }
}

void init()
{
    super();

    InventTransFormHelper::formQueryAddDynalink(inventTransOrigin_DS,inventTrans_DS,element.args());

    // Do not cache display methods more than once
    if (!hasCachedDisplayMethods)
    {
        inventTrans_ds.cacheAddMethod(tableMethodStr(InventTrans, unpostedInvoiceId));
        inventTrans_ds.cacheAddMethod(tableMethodStr(InventTrans, isNonFinancialTransfer));
        inventTrans_ds.cacheAddMethod(tableMethodStr(InventTrans, transferInventTransId));
        hasCachedDisplayMethods = true;
    }
}

int active()
{
    int ret;

    ret = super();

    inventDim_DS.active();
    element.enableButtons();

    return ret;
}

