public void jumpRef()
{
    if (inventTrans.TransChildType != InventTransChildType::None)
    {
        var childReference = InventTransChildReference::newFromInventTrans(InventTrans);

        if (childReference.hasReferenceSpecificJumpRef())
        {
            childReference.performJumpRef();
            return;
        }
    }
    super();
}

void init()
{
    Query   query = new Query();

    super();

    QueryBuildDataSource qbds = query.addDataSource(tableNum(InventTransPosting));
    qbds.addDynalink(fieldNum(InventTransPosting, Voucher),
                                      inventTrans,
                                      fieldNum(InventTrans,VoucherPhysical));

    qbds.addDynalink(fieldNum(InventTransPosting, TransDate),
                                      inventTrans,
                                      fieldNum(InventTrans,DatePhysical));

    qbds.addDynalink(fieldNum(InventTransPosting, InventTransOrigin),
                                      inventTrans,
                                      fieldNum(InventTrans,InventTransOrigin));

    qbds.addRange(fieldNum(InventTransPosting,InventTransPostingType)).value(queryValue(InventTransPostingType::Physical));

    inventTransPostingPhysical_DS.query(query);
}

void executeQuery()
{
    InventTransPosting inventTransPostingClear;

    if (inventTrans.VoucherPhysical)
    {
        super();
    }
    else
    {
        inventTransPostingPhysical.data(inventTransPostingClear);
        DimensionEntryControlPhysical.reactivate();
    }
}

